import React from 'react';
import { Switch, Route, useRouteMatch } from 'react-router-dom';
import Renta from '../sections/Renta';
import Venta  from '../sections/Venta';
import VentaCards from '../../layout/VentaCards';
import Paquete  from '../sections/Paquete';
import Condiciones  from '../sections/Condiciones';
import Nosotros  from '../sections/Nosotros';
import Negocio  from '../sections/Negocio';
import Preguntas  from '../sections/Preguntas';
//import ItemList from '../items/ItemList';
//import ItemDetail from '../items/ItemDetail';
import {SectionsContainer} from '../../elements/Container';


const Routes = () => {
  let { path, url } = useRouteMatch();
  console.log('path ... ')
  console.log(path)
  console.log('url ...')
  console.log(url)
  return (
    <SectionsContainer>
      <Switch>
        <Route exact path='/productos/:category' component={Renta} />
        <Route exact path='/venta/catalogo' component={Venta} />
        <Route exact path='/paquetes' component={Paquete} />
        <Route exact path='/condiciones' component={Condiciones} />
        <Route exact path='/nosotros' component={Nosotros} />
        <Route exact path='/negocio' component={Negocio} />
        <Route exact path='/preguntas' component={Preguntas} />
        <Route exact path='/venta' component={VentaCards}/>
      </Switch>
    </SectionsContainer>
  );
}

export default Routes;
